useEffect(() => {
    const url = "https://api.preqin.com/api/Investor?FirmId=2670";

    const fetchData = async () => {
      try {
        const response = await fetch(url);
        const json = await response.json();
        console.log(json);
      } catch (error) {
        console.log("error", error);
      }
    };

    fetchData();
}, []);
